        class=\"footer-dark\">\r\n\t\t\t\t<div class=\"cdb-footer__desc\">\r\n                    <p>
        CertDB provides aggregated information about SSL / TLS certificates issued
        around the world. The most important information about the\r\n                        <span
        class=\"cdb-hint__ct\">\r\n                        <span data-classname=\"cdb-hint__body\"
        data-content-id=\"cdb-tt-footer-1\" class=\"cdb-hint__head js-popper-tooltip\">expiry
        date</span>\r\n                        <span class=\"tooltip-content\" id=\"cdb-tt-footer-1\">\r\n
        \                           <span class=\"cdb-hint__body-h\">What is date
        of expiry?</span>\r\n                            <span>Date of expiry tells
        about final date of SSL/TLS certificate can be in use. After this date all
        transferred data will not encrypt and browser will notify all users, that
        current url has no protection for personal data from 3rd party </span>\r\n
        \                       </span>\r\n                    </span>\r\n                        of
        certificates helps in providing comprehensive monitoring of the security of\r\n
        \                       <span class=\"cdb-hint__ct\">\r\n                        <span
        data-classname=\"cdb-hint__body\" data-content-id=\"cdb-tt-footer-2\" class=\"cdb-hint__head
        js-popper-tooltip\">personal data</span>\r\n                        <span
        class=\"tooltip-content\" id=\"cdb-tt-footer-2\">\r\n                            <span
        class=\"cdb-hint__body-h\">Security of personal data.</span>\r\n                            <span>For
        online businesses or websites which accept credit or debit card payments,
        or involve the transfer of personal or sensitive information such as names
        and addresses, an SSL certificate is a necessity for website security. It's
        an essential way of making sure sites are secure and customers are protected,
        but crucially it also adds the appearance of security to online sites.</span>\r\n
        \                       </span>\r\n                    </span>, the encrypted
        transmission of which provides a certificate. In a constantly growing database,
        CertDB updates information about protected domains and ports, organizations,
        <span class=\"cdb-hint__ct\">\r\n                        <span data-classname=\"cdb-hint__body\"
        data-content-id=\"cdb-tt-footer-3\" class=\"cdb-hint__head js-popper-tooltip\">types
        of certificates</span>\r\n                        <span class=\"tooltip-content\"
        id=\"cdb-tt-footer-3\">\r\n                            <span class=\"cdb-hint__body-h\">Types
        of SSL/TLS certificates.</span>\r\n                            <span>As well
        as encryption, Certificate Authorities (CAs) can also authenticate the identity
        of the owner of a website, adding another layer of security. The SSL certificate
        is then used as proof of the companys identity. There are three types of
        SSL certificates, each requiring a different level of authentication: DV,
        OV and EV.</span>\r\n                            <!--<span><b>Domain Validation
        SSL Certificates (DV)</b>. These require businesses to prove their control
        over just the domain name. The certificate contains the domain name that was
        supplied to the issuing authority as part of the request. Because the identity
        of the organization is not checked here, Domain Validated certificates are
        the most basic level of SSL certification, and are only appropriate for test
        servers and internal links.</span>\r\n                            <span><b>Organization
        Validation SSL Certificates (OV)</b>. This requires the applicant to not only
        prove they own the domain name they wish sequre, but also prove that their
        company is registered and legally accountable as a business. The issued certificate
        is then proof of domain and company name. This level of authentication is
        suitable for public-facing websites that collect personal data from site users.
        This type of certificate is only for organizations and businesses, not for
        individuals.</span>\r\n                            <span><b>Extended Validation
        SSL Certificates (EV)</b>. Extended Validation SSL helps protect users from
        providing their details to fake website which can be used by criminals for
        phishing EV SSL requires both of the above validations for domain and company
        as well as several additional verification steps related to proving that the
        SSL certificate belongs to a registered company. This extra company information
        is then represented in the issued certificate on the address bar and can be
        accessed from many web browsers by clicking on the padlock icon. When visiting
        a site with EV SSL many browsers exhibit a green address bar as a highly visual
        sign of trust in the website and business to handle personal information.
        This type of certificate is also available to organizations and businesses
        only.</span>-->\r\n                        </span>\r\n                    </span>,
        issuers of certificates by country and region.<br>\r\n                        The
        CertDB team offers pre-configured groups of <a href=\"/top/1\" class=\"\">TOP-domains</a>,
        <a href=\"/countries\" class=\"\">TOP-countries</a>, <a href=\"/organizations\"
        class=\"\">TOP-organizations</a>, <a href=\"/issuers\" class=\"\">TOP-issuers</a>
        for quick viewing of ratings. The group New was set up to monitor the release
        of new certificates within the last 7 days. Group Expiring aggregated data
        about certificates that have expired in the last 7-1 days.</p>\r\n                    <p>For
        maximum user convenience, we provide the ability to connect to the <span class=\"cdb-hint__ct\">\r\n
        \                       <span data-classname=\"cdb-hint__body\" data-content-id=\"cdb-tt-footer-4\"
        class=\"cdb-hint__head js-popper-tooltip\"><a href=\"/api-documentation\">CertDB
        API</a></span>\r\n                        <span class=\"tooltip-content\"
        id=\"cdb-tt-footer-4\">\r\n                            <span class=\"cdb-hint__body-h\">What
        is API?</span>\r\n                            <span>API is a Application Programming
        Interface. An application program interface that provides a developer with
        programmatic access to a proprietary software application. A software intermediary
        that makes it possible for application programs to interact with each other
        and share data.</span>\r\n                        </span>\r\n                    </span>.
        You can collect data directly into your accounting and / or monitoring system.<br>\r\n
        \                       Visit <a href=\"/about\">About us</a> to find more
        information about CertDB.</p>\r\n                </div>\r\n\t\t\t</div>\r\n\t\t\t<hr
